  return {
    name: x,
    value: y
  };
}];
var scale = [{
  dataKey: 'x',
  min: 2
}, {
  dataKey: 'y',
  title: '时间',
  min: 1,
  max: 22
}];
export default {
  name: "Bar",
  props: {
    title: {
      type: String,
      default: ''
    }
  },
  mounted: function mounted() {
    this.datasource = data;
  },
  data: function data() {
    return {
      datasource: [],
      scale: scale,
      tooltip: tooltip
